namespace RonSijm.FluidHumidifier.Factories.Timestream;

public class ScheduledQueryFactory(string resourceName = null, Action<Humidifier.Timestream.ScheduledQuery> factoryAction = null) : ResourceFactory<Humidifier.Timestream.ScheduledQuery>(resourceName)
{

    internal InnerScheduledQueryErrorReportConfigurationFactory ErrorReportConfigurationFactory { get; set; }

    internal InnerScheduledQueryScheduleConfigurationFactory ScheduleConfigurationFactory { get; set; }

    internal InnerScheduledQueryTargetConfigurationFactory TargetConfigurationFactory { get; set; }

    internal InnerScheduledQueryNotificationConfigurationFactory NotificationConfigurationFactory { get; set; }

    protected override Humidifier.Timestream.ScheduledQuery Create()
    {
        var scheduledQueryResult = CreateScheduledQuery();
        factoryAction?.Invoke(scheduledQueryResult);

        return scheduledQueryResult;
    }

    private Humidifier.Timestream.ScheduledQuery CreateScheduledQuery()
    {
        var scheduledQueryResult = new Humidifier.Timestream.ScheduledQuery
        {
            GivenName = InputResourceName,
        };

        return scheduledQueryResult;
    }
    public override void CreateChildren(Humidifier.Timestream.ScheduledQuery result)
    {
        base.CreateChildren(result);

        result.ErrorReportConfiguration ??= ErrorReportConfigurationFactory?.Build();
        result.ScheduleConfiguration ??= ScheduleConfigurationFactory?.Build();
        result.TargetConfiguration ??= TargetConfigurationFactory?.Build();
        result.NotificationConfiguration ??= NotificationConfigurationFactory?.Build();
    }

} // End Of Class

